import React from "react";

import "./CodeLanguajes.css";

import reactJS from "../../images/reactJS.png";
import html5 from "../../images/html5.png";
import css from "../../images/css.png";
import js from "../../images/js.png";
import mongo from "../../images/mongo.png";
import github from "../../images/github.png";
import git from "../../images/git.png";
import angular from "../..//images/angular.png";

const CodeLanguajes = () => {
  return (
    <div className="codelanguajes col-12 col-md-6">
      <div className="d-flex flex-row justify-content-center flex-wrap p-2 border">
        <div className="col-2 m-1 ">
          <img
            className="codelanguajeslogo img-fluid"
            src={reactJS}
            alt="reactJs"
          />
        </div>
        <div className="col-2 m-1">
          <img
            className="codelanguajeslogo img-fluid"
            src={angular}
            alt="reactJs"
          />
        </div>
        <div className="col-2 m-1">
          <img
            className="codelanguajeslogo img-fluid"
            src={html5}
            alt="reactJs"
          />
        </div>
        <div className="col-2 m-1">
          <img
            className="codelanguajeslogo img-fluid"
            src={css}
            alt="reactJs"
          />
        </div>
        <div className="col-2">
          <img
            className="codelanguajeslogo img-fluid"
            src={mongo}
            alt="reactJs"
          />
        </div>
        <div className="col-2">
          <img
            className="codelanguajeslogo img-fluid"
            src={github}
            alt="reactJs"
          />
        </div>
        <div className="col-2 m-0 m-1">
          <img
            className="codelanguajeslogo img-fluid"
            src={git}
            alt="reactJs"
          />
        </div>
      </div>
    </div>
  );
};

export default CodeLanguajes;
